import '../css/resume.css';

function Resume(props) {
    return ( <section> 
                <h1>Employment History</h1>
                {props.prevJobs.map(item => {
                    if(item.contract === true)
                    {
                        <div key={item.id}>
                            <h3> {item.title}</h3>
                            <p>Company: {item.company} - Contracted Through {item.contractCompany}</p>
                            <p>Employment Dates: {item.dateStart} to {item.dateFinish}</p>
                            <p> {item.description} </p>
                        </div>
                    }else{
                        <div key={item.id}>
                            <h3> {item.title}</h3>
                            <p>Company: {item.company}</p>
                            <p>Employment Dates: {item.dateStart} to {item.dateFinish}</p>
                            <p> {item.description} </p>
                        </div>
                    }
                })};
            </section>
    )
}

export default Resume;
